import { selectMerchant } from "@redux";
import { useSelector } from "react-redux";
import styled from "styled-components";

export const ComponentHeaderAuth = () => {
    //page variable
    const merchant = useSelector(selectMerchant);
    console.log(merchant);

    return <StyledContainer bg_color={merchant.themeColor}>Header</StyledContainer>;
};

const StyledContainer = styled.div<{ bg_color: string }>`
    width: 100%;
    height: 190px;
    background-color: ${(p) => p.bg_color};
    position: relative;
`;
